import Link from 'next/link';

const UsersList = ()=>(
<div>
    <Link href="/User?name=Mehmet"><a>Mehmet</a></Link><br/>
    <Link href="/User?name=Ahmet"><a>Ahmet</a></Link>
</div>
)
export default UsersList;
